import React, { FC, useState } from 'react'
import './style.css'

interface IInput {
    type: 'password' | 'text';
    placeholder: string;
    value: string;
    label: string;
    onChange: (value: string) => void;
}

const Input: FC<IInput> = () => {
  return (
    <div>Input</div>
  )
}

export default Input
